    false,nt"url": null,nt"notes": "This narrative report for Fort Peck NWR
    and the easement refuges outlines Refuge accomplishments from May through August
    of 1962. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
    raptors, reptiles, and fish- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, and wildfires. Resource management
    is outlined; topics include grazing, haying, and commercial fishing. The public
    relations section of the report describes recreational uses, Refuge visitors, Refuge
    participation, and violations. Items of interest, N-R forms, and photographs are
    attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
